  Object.defineProperty(obj, property, {
    set(value) {
      if (value === undefined) {
        return
      }
      if (this[`_${property}`] === value) {
        return;
      }
      this[`_${property}`] = value;
      let data = {
        property: property,
        value: value
      };
      if (reflect) {
        if (value) this.setAttribute(property, String(value));
        else this.removeAttribute(property);
      }
      if (renderer) {
        if (typeof renderer === 'boolean') {
