        data.instance = this;
        PubSub.publish(`global.${property}`, data);
      } else if(fn) {
        if (this[fn]) {
          this[fn](data);
        } else {
          console.warn(`observer undefined::${fn} is not a function`);
        }
      }
    },
    get() {
      return this[`_${property}`];
